import React from 'react';
import './App.css';
import Categoria from './categoria.js';

function App() {
  return (
    <div className="App">
      <ul>
        <Categoria name = 'Home'></Categoria>
        <Categoria name = 'Cliente' items = {['Agregar','Modificar','Eliminar','Listar']}></Categoria>
        <Categoria name = 'Vendedor' items = {['Agregar','Modificar','Eliminar','Listar']}></Categoria>
        <Categoria name = 'Factura' items = {['Agregar','Modificar','Eliminar','Listar']}></Categoria>
        <Categoria name = 'Comision'></Categoria>
      </ul>
    </div>
  );
}

export default App;
